import { Routes, Route, useParams } from "react-router-dom";
import Information from "./components/Information";

function App() {
  return (
    <Routes>
      <Route path="info/:invoiceId" element={<Information />} />
    </Routes>
  );
}

function Invoice() {
  let params = useParams();
  return <h1>Invoice {params.invoiceId}</h1>;
}
